/** @format */

const Product = (props) => {
	const { product } = props;
	return (
		<div>
			<div className='card mb-3'>
				<h3 className='card-header'>{product.name}</h3>

				<img
					style={{
						height: "200px",
						width: "100%",
						display: "block",
					}}
					src={product.images[0].src}
					alt='Product image'
				></img>

				<div className='card-body'>
					<h6 className='card-subtitle text-muted'>{product.price}</h6>
				</div>
			</div>
		</div>
	);
};
export default Product;
